import logo from './logo.svg';
import './App.css';
import react, { Component } from 'react';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Frankenstain'
        },
        {
          name: 'Dracula'
        },
        {
          name: 'Zonbie'
        }

      ]
    }

  }

  render() {
    return(
      <div className="App">
        {this.state.monsters.map(pro => <h1>
          {pro.name}
        </h1>)}
      </div>
    );
  }
}

export default App;
